import React from "react";
import { Container,Card, Col, Row } from "react-bootstrap";

const Catigories = ({cat}) => {
    return(
       
            <Col xs={6} sm={6} md={4} lg={3} className="my-1">
                <div className="card">
                    <img src={cat.strCategoryThumb} className="card__image" alt="hu"/>
                    <div className="card-ca ">
                        <div className="text-center w-100 p-2">
                            <p>Film Title : </p>
                            <p>Film Date : </p>
                            <p>Number of Rate </p>
                            <p>Film Rate </p>
                        </div>
                    </div>
                </div>
        </Col>
    )
}
export default Catigories;
